import express from 'express';
import { query } from '../database.js';

const router = express.Router();

// GET /api/clients - Listar clientes com filtros
router.get('/', async (req, res) => {
  try {
    const {
      barbershop_id,
      search,
      status = 'active',
      page = 1,
      limit = 50,
      sort_by = 'name',
      sort_order = 'ASC'
    } = req.query;

    if (!barbershop_id) {
      return res.status(400).json({
        success: false,
        error: 'barbershop_id é obrigatório'
      });
    }

    const offset = (Number(page) - 1) * Number(limit);
    const validSortBy = ['name', 'client_since', 'total_visits', 'total_spent'];
    const validSortOrder = ['ASC', 'DESC'];

    const sortBy = validSortBy.includes(sort_by as string) ? sort_by : 'name';
    const sortOrder = validSortOrder.includes(sort_order as string) ? sort_order : 'ASC';

    let whereClause = 'WHERE c.barbershop_id = $1';
    const params = [barbershop_id];

    if (status && status !== 'all') {
      whereClause += ` AND c.status = $${params.length + 1}`;
      params.push(status);
    }

    if (search) {
      whereClause += ` AND (c.name ILIKE $${params.length + 1} OR c.phone ILIKE $${params.length + 1})`;
      params.push(`%${search}%`);
    }

    // Query principal
    const result = await query(`
      SELECT
        c.id, c.name, c.phone, c.email, c.birth_date,
        c.client_since, c.total_visits, c.total_spent, c.status,
        c.notes, c.created_at, c.updated_at,
        b.name as preferred_barber_name
      FROM clients c
      LEFT JOIN barbers b ON c.preferred_barber_id = b.id
      ${whereClause}
      ORDER BY c.${sortBy} ${sortOrder}
      LIMIT $${params.length + 1} OFFSET $${params.length + 2}
    `, [...params, limit, offset]);

    // Contar total de registros
    const countResult = await query(`
      SELECT COUNT(*) as total
      FROM clients c
      ${whereClause}
    `, params);

    const total = parseInt(countResult.rows[0].total);
    const totalPages = Math.ceil(total / Number(limit));

    res.json({
      success: true,
      data: result.rows,
      pagination: {
        page: Number(page),
        limit: Number(limit),
        total,
        totalPages,
        hasNext: Number(page) < totalPages,
        hasPrev: Number(page) > 1
      }
    });
  } catch (error: any) {
    console.error('Error fetching clients:', error);
    res.status(500).json({
      success: false,
      error: 'Erro ao buscar clientes',
      message: process.env.NODE_ENV === 'development' ? error.message : undefined
    });
  }
});

// GET /api/clients/:id - Buscar cliente por ID
router.get('/:id', async (req, res) => {
  try {
    const { id } = req.params;

    const result = await query(`
      SELECT
        c.id, c.name, c.phone, c.email, c.birth_date, c.address,
        c.client_since, c.total_visits, c.total_spent, c.status,
        c.notes, c.created_at, c.updated_at,
        b.name as preferred_barber_name,
        b.id as preferred_barber_id
      FROM clients c
      LEFT JOIN barbers b ON c.preferred_barber_id = b.id
      WHERE c.id = $1
    `, [id]);

    if (result.rows.length === 0) {
      return res.status(404).json({
        success: false,
        error: 'Cliente não encontrado'
      });
    }

    res.json({
      success: true,
      data: result.rows[0]
    });
  } catch (error: any) {
    console.error('Error fetching client:', error);
    res.status(500).json({
      success: false,
      error: 'Erro ao buscar cliente',
      message: process.env.NODE_ENV === 'development' ? error.message : undefined
    });
  }
});

// POST /api/clients - Criar novo cliente
router.post('/', async (req, res) => {
  try {
    const {
      barbershop_id,
      name,
      phone,
      email,
      birth_date,
      address,
      preferred_barber_id,
      notes
    } = req.body;

    // Validações básicas
    if (!barbershop_id || !name) {
      return res.status(400).json({
        success: false,
        error: 'barbershop_id e name são obrigatórios'
      });
    }

    // Verificar se a barbearia existe
    const barbershopCheck = await query('SELECT id FROM barbershops WHERE id = $1', [barbershop_id]);
    if (barbershopCheck.rows.length === 0) {
      return res.status(400).json({
        success: false,
        error: 'Barbearia não encontrada'
      });
    }

    // Verificar se já existe cliente com mesmo telefone na barbearia
    if (phone) {
      const phoneCheck = await query(
        'SELECT id FROM clients WHERE barbershop_id = $1 AND phone = $2',
        [barbershop_id, phone]
      );
      if (phoneCheck.rows.length > 0) {
        return res.status(400).json({
          success: false,
          error: 'Já existe um cliente com este telefone nesta barbearia'
        });
      }
    }

    const result = await query(`
      INSERT INTO clients (
        barbershop_id, name, phone, email, birth_date,
        address, preferred_barber_id, notes
      )
      VALUES ($1, $2, $3, $4, $5, $6, $7, $8)
      RETURNING id, name, phone, email, birth_date, client_since, status, created_at
    `, [barbershop_id, name, phone, email, birth_date, address, preferred_barber_id, notes]);

    res.status(201).json({
      success: true,
      data: result.rows[0],
      message: 'Cliente criado com sucesso'
    });
  } catch (error: any) {
    console.error('Error creating client:', error);
    res.status(500).json({
      success: false,
      error: 'Erro ao criar cliente',
      message: process.env.NODE_ENV === 'development' ? error.message : undefined
    });
  }
});

// PUT /api/clients/:id - Atualizar cliente
router.put('/:id', async (req, res) => {
  try {
    const { id } = req.params;
    const {
      name,
      phone,
      email,
      birth_date,
      address,
      preferred_barber_id,
      status,
      notes
    } = req.body;

    // Verificar se o cliente existe
    const checkResult = await query('SELECT id, barbershop_id FROM clients WHERE id = $1', [id]);
    if (checkResult.rows.length === 0) {
      return res.status(404).json({
        success: false,
        error: 'Cliente não encontrado'
      });
    }

    // Verificar telefone duplicado (excluindo o próprio cliente)
    if (phone) {
      const phoneCheck = await query(
        'SELECT id FROM clients WHERE barbershop_id = $1 AND phone = $2 AND id != $3',
        [checkResult.rows[0].barbershop_id, phone, id]
      );
      if (phoneCheck.rows.length > 0) {
        return res.status(400).json({
          success: false,
          error: 'Já existe outro cliente com este telefone nesta barbearia'
        });
      }
    }

    const result = await query(`
      UPDATE clients
      SET name = COALESCE($2, name),
          phone = COALESCE($3, phone),
          email = COALESCE($4, email),
          birth_date = COALESCE($5, birth_date),
          address = COALESCE($6, address),
          preferred_barber_id = COALESCE($7, preferred_barber_id),
          status = COALESCE($8, status),
          notes = COALESCE($9, notes),
          updated_at = NOW()
      WHERE id = $1
      RETURNING id, name, phone, email, birth_date, status, updated_at
    `, [id, name, phone, email, birth_date, address, preferred_barber_id, status, notes]);

    res.json({
      success: true,
      data: result.rows[0],
      message: 'Cliente atualizado com sucesso'
    });
  } catch (error: any) {
    console.error('Error updating client:', error);
    res.status(500).json({
      success: false,
      error: 'Erro ao atualizar cliente',
      message: process.env.NODE_ENV === 'development' ? error.message : undefined
    });
  }
});

// DELETE /api/clients/:id - Deletar cliente
router.delete('/:id', async (req, res) => {
  try {
    const { id } = req.params;

    // Verificar se o cliente existe
    const checkResult = await query('SELECT id, name FROM clients WHERE id = $1', [id]);
    if (checkResult.rows.length === 0) {
      return res.status(404).json({
        success: false,
        error: 'Cliente não encontrado'
      });
    }

    // Verificar se o cliente tem agendamentos
    const appointmentsCheck = await query(
      'SELECT COUNT(*) as count FROM appointments WHERE client_id = $1',
      [id]
    );

    if (parseInt(appointmentsCheck.rows[0].count) > 0) {
      // Se tem agendamentos, apenas desativar
      await query(`
        UPDATE clients
        SET status = 'inactive', updated_at = NOW()
        WHERE id = $1
      `, [id]);

      return res.json({
        success: true,
        message: 'Cliente desativado com sucesso (possui histórico de agendamentos)'
      });
    } else {
      // Se não tem agendamentos, pode deletar
      await query('DELETE FROM clients WHERE id = $1', [id]);

      return res.json({
        success: true,
        message: 'Cliente removido com sucesso'
      });
    }
  } catch (error: any) {
    console.error('Error deleting client:', error);
    res.status(500).json({
      success: false,
      error: 'Erro ao remover cliente',
      message: process.env.NODE_ENV === 'development' ? error.message : undefined
    });
  }
});

// GET /api/clients/:id/history - Histórico do cliente
router.get('/:id/history', async (req, res) => {
  try {
    const { id } = req.params;
    const { limit = 20, page = 1 } = req.query;

    // Verificar se o cliente existe
    const checkResult = await query('SELECT id, name FROM clients WHERE id = $1', [id]);
    if (checkResult.rows.length === 0) {
      return res.status(404).json({
        success: false,
        error: 'Cliente não encontrado'
      });
    }

    const offset = (Number(page) - 1) * Number(limit);

    // Buscar histórico de agendamentos
    const appointmentsResult = await query(`
      SELECT
        a.id, a.appointment_date, a.appointment_time, a.status, a.price, a.notes,
        b.name as barber_name,
        s.name as service_name, s.category as service_category
      FROM appointments a
      JOIN barbers b ON a.barber_id = b.id
      JOIN services s ON a.service_id = s.id
      WHERE a.client_id = $1
      ORDER BY a.appointment_date DESC, a.appointment_time DESC
      LIMIT $2 OFFSET $3
    `, [id, limit, offset]);

    // Buscar estatísticas
    const statsResult = await query(`
      SELECT
        COUNT(*) as total_appointments,
        COUNT(*) FILTER (WHERE status = 'completed') as completed_appointments,
        COUNT(*) FILTER (WHERE status = 'cancelled') as cancelled_appointments,
        COALESCE(SUM(price), 0) as total_spent_calculated,
        MIN(appointment_date) as first_appointment,
        MAX(appointment_date) as last_appointment
      FROM appointments
      WHERE client_id = $1
    `, [id]);

    res.json({
      success: true,
      data: {
        appointments: appointmentsResult.rows,
        stats: statsResult.rows[0]
      }
    });
  } catch (error: any) {
    console.error('Error fetching client history:', error);
    res.status(500).json({
      success: false,
      error: 'Erro ao buscar histórico do cliente',
      message: process.env.NODE_ENV === 'development' ? error.message : undefined
    });
  }
});

// GET /api/clients/search - Busca rápida de clientes
router.get('/search', async (req, res) => {
  try {
    const { barbershop_id, q } = req.query;

    if (!barbershop_id || !q) {
      return res.status(400).json({
        success: false,
        error: 'barbershop_id e q (query) são obrigatórios'
      });
    }

    const result = await query(`
      SELECT id, name, phone, status
      FROM clients
      WHERE barbershop_id = $1
        AND (name ILIKE $2 OR phone ILIKE $2)
        AND status = 'active'
      ORDER BY name
      LIMIT 10
    `, [barbershop_id, `%${q}%`]);

    res.json({
      success: true,
      data: result.rows
    });
  } catch (error: any) {
    console.error('Error searching clients:', error);
    res.status(500).json({
      success: false,
      error: 'Erro ao buscar clientes',
      message: process.env.NODE_ENV === 'development' ? error.message : undefined
    });
  }
});

export default router;

