import express from 'express';
import { MockDatabase } from '../database/mockData.js';

const router = express.Router();

// GET /api/barbers - Listar barbeiros
router.get('/', async (req, res) => {
  try {
    const { barbershop_id } = req.query;

    if (!barbershop_id) {
      return res.status(400).json({
        success: false,
        error: 'barbershop_id é obrigatório'
      });
    }

    const barbers = MockDatabase.getBarbers(barbershop_id as string);

    res.json({
      success: true,
      data: barbers.map(barber => ({
        id: barber.id,
        name: barber.name,
        email: barber.email,
        phone: barber.phone,
        specialty: barber.specialty,
        bio: barber.bio,
        commission_rate: barber.commission_rate,
        working_hours: barber.working_hours,
        days_off: barber.days_off,
        active: barber.active,
        created_at: barber.created_at
      }))
    });
  } catch (error: any) {
    console.error('Error fetching barbers:', error);
    res.status(500).json({
      success: false,
      error: 'Erro ao buscar barbeiros',
      message: process.env.NODE_ENV === 'development' ? error.message : undefined
    });
  }
});

// POST /api/barbers - Criar novo barbeiro
router.post('/', async (req, res) => {
  try {
    const {
      barbershop_id,
      name,
      email,
      phone,
      specialty,
      bio,
      commission_rate,
      working_hours,
      days_off
    } = req.body;

    if (!barbershop_id || !name || !email || !phone) {
      return res.status(400).json({
        success: false,
        error: 'barbershop_id, name, email e phone são obrigatórios'
      });
    }

    const newBarber = MockDatabase.createBarber({
      barbershop_id,
      name,
      email,
      phone,
      specialty,
      bio,
      commission_rate,
      working_hours,
      days_off,
      active: true
    });

    res.status(201).json({
      success: true,
      data: newBarber,
      message: 'Barbeiro criado com sucesso'
    });
  } catch (error: any) {
    console.error('Error creating barber:', error);
    res.status(500).json({
      success: false,
      error: 'Erro ao criar barbeiro',
      message: process.env.NODE_ENV === 'development' ? error.message : undefined
    });
  }
});

export default router;

