    const checkResult = await query('SELECT id FROM appointments WHERE id = $1', [id]);
    if (checkResult.rows.length === 0) {
      return res.status(404).json({
        success: false,
        error: 'Agendamento não encontrado'
      });
    }

    const result = await query(`
      UPDATE appointments
      SET status = $2, updated_at = NOW()
      WHERE id = $1
      RETURNING id, status, updated_at
    `, [id, status]);

    res.json({
      success: true,
      data: result.rows[0],
      message: 'Status atualizado com sucesso'
    });
  } catch (error: any) {
    console.error('Error updating appointment status:', error);
    res.status(500).json({
      success: false,
      error: 'Erro ao atualizar status',
      message: process.env.NODE_ENV === 'development' ? error.message : undefined
    });
  }
});

// DELETE /api/appointments/:id - Cancelar agendamento
router.delete('/:id', async (req, res) => {
  try {
    const { id } = req.params;
    const { reason } = req.body;

    const checkResult = await query('SELECT id, status FROM appointments WHERE id = $1', [id]);
    if (checkResult.rows.length === 0) {
      return res.status(404).json({
        success: false,
        error: 'Agendamento não encontrado'
      });
    }

    if (checkResult.rows[0].status === 'completed') {
      return res.status(400).json({
        success: false,
        error: 'Não é possível cancelar agendamento já completado'
      });
    }

    await query(`
      UPDATE appointments
      SET status = 'cancelled',
          notes = COALESCE(notes || ' | ', '') || 'Cancelado: ' || COALESCE($2, 'Sem motivo informado'),
          updated_at = NOW()
      WHERE id = $1
    `, [id, reason]);

    res.json({
      success: true,
      message: 'Agendamento cancelado com sucesso'
    });
  } catch (error: any) {
    console.error('Error canceling appointment:', error);
    res.status(500).json({
      success: false,
      error: 'Erro ao cancelar agendamento',
      message: process.env.NODE_ENV === 'development' ? error.message : undefined
    });
  }
});

